import React, {useEffect} from 'react';
import Stack from "@mui/material/Stack";
import { AircraftItem } from './AircraftItem';
import { Paper } from '@mui/material';
import useRotationStack from '../../../store/useRotationStack';

type Props = {
  aircrafts: any;
};

const Aircrafts: React.FC<Props> = ({aircrafts}) => {
    const { flightsRotation } = useRotationStack((state) => ({
      flightsRotation: state.flightsRotation,
    }));

    return (
      <Paper sx={{ height: "90vh", width: "40vh" }}>
        <div className="aircraft-title">
          <b>Aircrafts</b>
        </div>
        <Stack
          direction="column"
          justifyContent="space-evenly"
          alignItems="center"
          spacing={2}
        >
          {aircrafts.map((aircraft: any) => (
            <AircraftItem
              aircraft={aircraft}
              key={`aircraftItem-${aircraft.id}`}
            />
          ))}
        </Stack>
      </Paper>
    );
};

export default Aircrafts;
